async function updateAppointmentStatus(req, res) {
  try {
    const { id } = req.params;
    const { status, messageFromDoctor, newDate } = req.body;

    const appointment = await Appointment.findById(id);
    if (!appointment) {
      return res.status(404).json({ error: 'Appointment not found' });
