const Notification = require('../models/Notification');

const NOTIFICATION_TYPES = Object.freeze({
  RECORD_HIGH: 'record_high',
  PRESCRIPTION_NEW: 'prescription_new',
  LAB_REQUEST: 'lab_request',
  LAB_RESULT: 'lab_result',
  COMMENT: 'comment',
  MESSAGE: 'message',
  APPOINTMENT: 'appointment',
  SYSTEM: 'system'
});

async function createNotification({ user, sender = null, type, message, link = null, meta = null }) {
  if (!user || !type || !message) return null;
  try {
    const doc = await Notification.create({ user, sender, type, message, link, meta });
    return doc;
  } catch (err) {
    console.error('[notificationService:createNotification]', err.message);
    return null;
  }
}

async function listNotifications(userId, { limit = 20 } = {}) {
  if (!userId) return [];
  const size = Math.max(1, Math.min(Number(limit) || 20, 100));
  return Notification.find({ user: userId })
    .sort({ createdAt: -1 })
    .limit(size)
    .populate('sender', 'fullName role');
}

async function markAsRead(userId, notificationId) {
  if (!userId || !notificationId) return null;
  const notif = await Notification.findOne({ _id: notificationId, user: userId });
  if (!notif) return null;
  if (!notif.read) {
    notif.read = true;
    await notif.save();
  }
  return notif;
}

async function markAllAsRead(userId) {
  if (!userId) return 0;
  const result = await Notification.updateMany({ user: userId, read: false }, { $set: { read: true } });
  return result.modifiedCount || 0;
}

async function deleteNotification(userId, notificationId) {
  if (!userId || !notificationId) return false;
  const res = await Notification.deleteOne({ _id: notificationId, user: userId });
  return res.deletedCount > 0;
}

async function unreadCount(userId) {
  if (!userId) return 0;
  return Notification.countDocuments({ user: userId, read: false });
}

module.exports = {
  createNotification,
  listNotifications,
  markAsRead,
  markAllAsRead,
  deleteNotification,
  unreadCount,
  NOTIFICATION_TYPES
};

