// frontend/doctor/doctor-dashboard.js
class DoctorDashboard {
  constructor() {
    this.notifications = [];
    this.unreadCount = 0;
    this.init();
  }

  init() {
    this.loadNotifications();
    this.loadPatients();
    this.loadLabRequests();
    this.loadAppointments();
    this.bindEvents();
    this.startPolling();
  }

  bindEvents() {
