        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      if (response.ok) {
        const appointments = await response.json();
        this.renderAppointments(appointments);
      }
    } catch (err) {
      console.error('Failed to load appointments', err);
    }
  }

