:root{
  --turquoise:#20caa8;
  --white:#ffffff;
  --muted:#6b7280;
  --card-bg:#f8fbfa;
  --max-width:1200px;
}
*{box-sizing:border-box}
body{margin:0;font-family:Inter,Segoe UI,Roboto,Arial,sans-serif;background:var(--white);color:#1f2937}
.pd-header{background:var(--white);border-bottom:1px solid #e6f4ef;position:sticky;top:0;z-index:20}
.pd-header-inner{max-width:var(--max-width);margin:0 auto;display:flex;align-items:center;justify-content:space-between;padding:12px 16px}
.logo{font-weight:800;color:var(--turquoise);text-decoration:none;font-size:20px}
.icon-btn{background:transparent;border:0;font-size:18px;cursor:pointer;padding:6px;border-radius:6px}
.icon-btn:focus{outline:2px solid rgba(32,202,168,0.15)}
.pd-center{flex:1;text-align:center}
.pd-right{display:flex;gap:8px;align-items:center}
.dropdown{position:relative}
.dropdown-menu{display:none;position:absolute;right:0;top:36px;background:var(--white);border:1px solid #e6f4ef;box-shadow:0 6px 18px rgba(0,0,0,0.06);min-width:160px;padding:8px;border-radius:6px}
.dropdown:hover .dropdown-menu,.dropdown .dropdown-menu.show{display:block}
.dropdown-menu a,.dropdown-menu button{display:block;width:100%;text-align:left;padding:8px;border:0;background:transparent;color:#111;font-size:14px}

.pd-main{max-width:var(--max-width);margin:20px auto;display:grid;grid-template-columns:240px 1fr;gap:20px;padding:0 16px}
.pd-sidebar{position:sticky;top:72px;height:calc(100vh - 90px);overflow:auto}
.pd-nav ul{list-style:none;padding:0;margin:0}
.pd-nav li{padding:10px 12px;border-radius:8px;color:#0f172a;cursor:pointer;margin-bottom:6px}
.pd-nav li.active{background:linear-gradient(90deg,var(--turquoise),#36d6b6);color:var(--white);font-weight:600}

.pd-content{min-height:60vh}
.card{background:var(--card-bg);border-radius:var(--radius);padding:18px;margin-bottom:18px;box-shadow:var(--shadow)}
.card h2{margin:0 0 12px 0;color:#064b43}

/* daily form */
.measure-form{display:grid;grid-template-columns:repeat(2,1fr);gap:12px}
.form-row{display:flex;flex-direction:column}
.form-row label{font-size:13px;color:var(--muted);margin-bottom:6px}
.form-row input[type=number],.form-row textarea{padding:10px;border:1px solid #e6f4ef;border-radius:8px;font-size:14px}
.form-actions{display:flex;gap:8px;align-items:center;margin-top:12px}
.btn{background:var(--turquoise);color:var(--white);border:0;padding:10px 14px;border-radius:8px;cursor:pointer;font-weight:600}
.btn.secondary{background:#fff;border:1px solid #d1f1e9;color:var(--turquoise)}
.warning{padding:10px;border-radius:8px;background:#fff7ed;color:#92400e;margin-top:10px}
.critical{padding:10px;border-radius:8px;background:#fff1f2;color:#9f1239;margin-top:10px}

.grid-cards .grid{display:grid;grid-template-columns:repeat(3,1fr);gap:12px}
.menu-card{display:flex;flex-direction:column;align-items:center;justify-content:center;padding:18px;border-radius:var(--radius);background:var(--card-bg);box-shadow:var(--shadow);border:1px solid rgba(224,244,239,0.6);cursor:pointer}
.menu-card .mc-icon{font-size:28px;margin-bottom:8px}

/* responsive */
@media (max-width:900px){
  .pd-main{grid-template-columns:1fr;}
  .pd-sidebar{order:2;position:static;height:auto}
  .pd-nav{display:flex;overflow:auto}
  .pd-nav li{flex:0 0 auto;margin-right:8px}
  .grid-cards .grid{grid-template-columns:repeat(2,1fr)}
  .measure-form{grid-template-columns:1fr}
}
@media (max-width:480px){
  .grid-cards .grid{grid-template-columns:1fr}
}

.pd-footer{position:relative;margin-top:32px}
.wave-svg{display:block;width:100%;height:90px}
.footer-content{max-width:var(--max-width);margin:0 auto;padding:12px 16px;text-align:center;color:#fff;background:transparent}

/* Footer cards: keep same card format but constrained inside footer */
.pd-footer .footer-cards{max-width:var(--max-width);margin:0 auto 12px;padding:12px 16px}

